import React from 'react';
import CommunityHighlights from '../components/CommunityHighlights';
import SubCommunities from '../components/SubCommunities';

const CommunityPage = () => (
  <div>
    <h2>Community Showcase</h2>
    <CommunityHighlights />
    <SubCommunities />
  </div>
);

export default CommunityPage;
